import React from "react";
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';
import "./scrollup.css"
import { Shake } from 'reshake'




const ScrollUp = (props) => {



    const scrollUp = () => {

        window.scrollTo({
            top: 0,
            behavior: "smooth"
        })

    }

    return (
        <div>
            <Shake h={1} v={0} r={3}>

                <button onClick={scrollUp}
                    className="scrollUpBtn">
                    <ArrowUpwardIcon />
                </button>

            </Shake>



        </div >
    )
}

export default ScrollUp;
